desc:
When this card is activated: Banish 1 Ritual Monster from your Deck. You can only use the following effect of "Return of the World" once per turn. You can send this card to the GY, then activate 1 of these effects;
&#x2022; Ritual Summon the Ritual Monster banished by this card's effect, by Tributing 1 monster from your hand whose Level equals or exceeds that banished monster's OR by shuffling into the Deck, 1 Ritual Monster from your GY whose Level equals or exceeds that banished monster's.
&#x2022; Add the monster banished by this card's effect to your hand.
